import axios from 'axios'
import { BASE_URL } from './Constants/url'

const DelMatch = () => {

        axios
          .put(`${BASE_URL}clear`)
          .then((res) => {
           alert("Apagou os metches todos!")
          })
          .catch((error) => {
            alert(error.response.data)
          })


return(
  <div className="trash">
      <button onClick={DelMatch}>
            Apagar Matches

      </button>
      </div>
)

}
export default DelMatch
